import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state ={
      monsters :[
        {
          name: 'Anoosha',
          id:'a101'
        },
        {
          name: 'Dracula',
          id:'a102'
        },
        {
          name: 'Zombie',
          id:'a103'
        },
        {
          name: 'Jundi',
          id:'a104'
        },

      ] 
    };
  }

  render(){
  return (
    <div className="App">
      {
        this.state.monsters.map(monster=>(
          <h1 key = {monster.id}>
            {monster.name}
          </h1>
        ))
      }
    </div>
  );
  }
}

export default App;
